<div class="entities" style="line-height: 2.5; direction: ltr">Recent advances in autoimmune pancreatitis : concept , diagnosis , and pathogenesis . Recent advances support the concept of autoimmune pancreatitis ( AIP ) as a unique systemic disease , because it shows occasional extrapancreatic lesions such as sclerosing cholangitis , sclerosing sialoadenitis , and retroperitoneal fibrosis , pathological features similar to those of fibrosis , and abundant infiltration of IgG 4 - positive plasma cells , and it is steroid responsive . Based on these findings , several diagnostic criteria have been proposed . Although AIP is accepted worldwide as a unique clinical entity , its pathogenetic mechanism remains unclear . To clarify its pathogenesis , its genetic background , humoral immunity , candidate target antigens including self-antigens and molecular mimicry by microbes , and cellular immunity including regulatory T cells , the complement system , and experimental models are reviewed . On the basis of this review , we hypothesize that the pathogenesis of AIP involves a biphasic mechanism consisting of &quot; induction &quot; and &quot; progression . &quot; In the early stage , the initial response to self-antigens [ lactoferrin , carbonic anhydrase ( CA ) - II ,

 , pancreatic secretory trypsin inhibitor , and alpha-fodrin ] and molecular mimicry ( Helicobacter pylori ) are induced by decreased nave regulatory T cells ( Tregs ) , and T-helper ( Th ) 1 cells release proinflammatory cytokines [ interferon-gamma , interleukin ( IL ) - 1beta , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">The cholinergic system is involved in regulation of the development of the hematopoietic system . Gene expression profiling demonstrated that components of the cholinergic system , including choline acetyltransferase , acetylcholinesterase and nicotinic acetylcholine receptors ( nAChRs ) , are expressed in embryonic stem cells and differentiating embryoid bodies ( EBs ) . Triggering of nAChRs expressed in EBs by nicotine resulted in activation of MAPK and shifts of spontaneous differentiation toward hemangioblast . In vivo , non-neural nAChRs are detected early during development in fetal sites of hematopoiesis . Similarly , in vivo exposure of the developing embryo to nicotine resulted in higher numbers of hematopoietic progenitors in fetal liver . However postpartum , the number of hematopoietic stem / progenitor cells (
